  console.log('üé§ ÊµãËØïÂÜÖÂÆπ: ËØ≠Èü≥ËÅäÂ§©ÂäüËÉΩ (Èü≥È¢ëÊï∞ÊçÆ‰∏ä‰º†)');
  console.log(`üåê Âõ∫ÂÆöËØ≠Ë®Ä: ${FIXED_VOICE_LANGUAGE}`);
  console.log('üì° ÂìçÂ∫îÁ±ªÂûã: Server-Sent Events (ÊµÅÂºè)');
